import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';

function App () {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<h1>Hello</h1>} />
        <Route path="/products" element={<h1>about</h1>} />
        <Route path="/contact" element={<h1>contact</h1>} />
      </Routes>
    </Router>
  );
}

export default App;
